contracts/Project.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.13;


contract Project {

    enum State {
        Fundraising,
        Expired,
        Successful
    }
    address payable public projectCreator;
    string projectTitle;
    string projectDescription; // IPFS
    uint256 amountGoal;
    uint256 currentBalance;
    State state;
    uint deadLine; // To be converted to date
    mapping(address=>uint) contributions;




    constructor
    (
        address payable _projectCreator,
        string memory _projectTitle,
        string memory _projectDescription,
        uint256 _amountGoal,
        uint _deadLine
    ) {
        projectCreator = _projectCreator;
        projectTitle = _projectTitle;
        projectDescription = _projectDescription;
        amountGoal = _amountGoal;
        deadLine = _deadLine;
        currentBalance = 0;
    }

    function start(string memory _projectTitle, string memory _projectDescription, 
        uint256 _amountGoal, uint256 _deadLine) public {
            projectCreator = payable(msg.sender);
            projectTitle = _projectTitle;
            projectDescription = _projectDescription;
            amountGoal = _amountGoal;
            deadLine = _deadLine;
        } 





    function getProjectTitle() public view returns(string memory) {
        return projectTitle;
    }

    function setProjectTitle(string memory _projectTitle) public {
        projectTitle = _projectTitle;
    }




}

